import { useEffect } from "react";
import Featured from "../../components/featured/Featured";
import FeaturedProperties from "../../components/featuredProperties/FeaturedProperties";
import Footer from "../../components/footer/Footer";
import Header from "../../components/header/Header";
import MailList from "../../components/mailList/MailList";
import Navbar from "../../components/navbar/Navbar";
import PropertyList from "../../components/propertyList/PropertyList";
import "./home.css";
import axios from "axios";

const Home = () => {
    const url = "http://localhost:5000/home-page";

    let featureData;
    let propertyListData;
    let featuredPropertiesData;
    useEffect(() => {
        axios
            .get(url)
            .then((data) => {
                featureData = data.data.area;
                propertyListData = data.data.hotelTypes;
                featureData = data.data.hightRateHotels;
            })
            .catch((err) => {
                console.log(err);
            });
    }, []);
    return (
        <div>
            <Navbar />
            <Header />
            <div className="homeContainer">
                <Featured data={featureData} />
                <h1 className="homeTitle">Browse by property type</h1>
                <PropertyList />
                <h1 className="homeTitle">Homes guests love</h1>
                <FeaturedProperties />
                <MailList />
                <Footer />
            </div>
        </div>
    );
};

export default Home;
